import React, { Component } from 'react';
import './App.css';
import Todo from './Todo';
import NewTodo from './NewTodo';

class App extends Component {
  render() {
    return (
        <div className="App">
          <div className="container-fluid">
            <div class="row">
                <div class="title">To-Do List</div>
            </div>

          <NewTodo></NewTodo>
          <Todo></Todo>
        </div>
        </div>
    );
  }
}

export default App;
